func outputPropertyDiff(header string, property Property, file string){
   if input.ToConsole {
      log.Info(header, property)
   }

   if input.OutputFolder != "" {
      err := os.MkdirAll(input.OutputFolder, 0700)
      if err != nil {
         fmt.Println("i")
         panic(err)
      }
      f, err := os.OpenFile(input.OutputFolder + "/" + file, os.O_CREATE|os.O_APPEND|os.O_WRONLY, 0600)
      if err != nil {
         panic(err)
      }
      defer f.Close()
      f.WriteString(fmt.Sprint(header, property, "\n"))
   }
}


func applyMatchingPatterns(value string, matchedPatterns []Patterns) (string){
   result := value
   for _, patterns := range matchedPatterns {
      for _, pattern := range patterns.What {
         result = strings.Replace(result, pattern, patterns.ReplaceWith, -1)
      }
   }

   return result
}


func allTheSameValues(src, dest string) (bool) {
   for _, s := range strings.Split(src, ",") {
      isEqual := false
      for _, d := range strings.Split(dest, ",") {
         if s == d {
            isEqual = true
         }
      }
      if isEqual == false {
         return false
      }
   }
   return true
}


func tryToFndTheDifference(property Property, matchedPatterns []Patterns) (bool){
   theSame := false

   s0 := applyMatchingPatterns(property.Info[0].Value, matchedPatterns)

   for i := 1; i < len(property.Info); i++ {
      si := applyMatchingPatterns(property.Info[i].Value, matchedPatterns)
      if si != s0 {
         theSame = allTheSameValues(s0, si)
         break
      } else {
         theSame = true
      }
   }

   return theSame
}


func uploadMatchingFolder(filename string, matchedPatterns []Patterns) ([]Patterns){
   if file, err := os.Open("config/" + filename); err == nil {
      defer file.Close()

      scanner := bufio.NewScanner(file)
      for scanner.Scan() {
         data := strings.Split(scanner.Text(), "=")
         matchedPatterns = append(matchedPatterns, Patterns{data[0], strings.Split(data[1], ",")})
      }     
   }

   return matchedPatterns
}



func uploadListFromFile(filename string) []string{
   result := make([]string, 0)
   if file, err := os.Open("config/" + filename); err == nil {
      defer file.Close()

      scanner := bufio.NewScanner(file)
      for scanner.Scan() {
         result = append(result, scanner.Text())
      }     
   }

   return result
}



func tryToFindIgnoredPatterns(propertyName string, patterns []string) (bool){
   for _, pattern := range patterns {
      matched, _ := regexp.MatchString(pattern, propertyName)
      if matched {
         return true
      }
   }

   return false
}


func processingProperties(properties []Property, amountOfClusters int, config Config){
   var matchedPatterns []Patterns


   matchedPatterns = uploadMatchingFolder("_default_", matchedPatterns)
   matchedPatterns = uploadMatchingFolder(config.Name, matchedPatterns)

   ignoredPatterns := uploadListFromFile("_ignores_")
   fmt.Println("ignorant: ", ignoredPatterns)

   // fmt.Println(matchedPatterns)

   for _, property := range properties {
      if tryToFindIgnoredPatterns(property.Name, ignoredPatterns) {
         log.Debug("Ignoring property: ", property.Name)
         continue
      }

      hasTheSameValues := tryToFndTheDifference(property, matchedPatterns)

      if amountOfClusters != len(property.Info){
         outputPropertyDiff("[LACK OF DATA] ", property, config.Name)
      } else if !hasTheSameValues {
         outputPropertyDiff("[NOT THE SAME] ", property, config.Name)
      }

   }
}


// -----------------------------------------------------------------------------------------------------------------------
func parse_arguments(){
   flag.StringVar(&input.LogLevel, "log-level", "INFO", "log level")
   flag.BoolVar(&input.ToConsole, "console", false, "output to console")
   flag.StringVar(&input.OutputFolder, "output", "", "output folder")
   flag.BoolVar(&input.NoTimestamp, "no-timestamp", false, "skip timestamp in folder name")
   flag.BoolVar(&input.NoLackOfData, "no-lack", false, "do not print '[lack of data]' messages")
   flag.BoolVar(&input.NoConfigsInOutput, "no-configs", false, "skip configs when producing difference")

   flag.StringVar(&input.ClustersFilter, "clusters", "*", "list of clusters")

   flag.StringVar(&input.ConfigFile, "config", "", "config file with defaults")
   flag.StringVar(&input.MatchingPatterns, "mpatterns", "", "folder with matching patterns")

   var configs = flag.String("configs", "*", "list of HDP configs to be compared")
   
   flag.Parse()

   input.ConfigsFilter = strings.Split(*configs, ",")
   input.LogLevel = strings.ToLower(input.LogLevel)

   file, err := ioutil.ReadFile(input.ConfigFile)
   if err != nil {
      log.Error("Error: ", err, " with file ", input.ConfigFile)
   }
   if json.Unmarshal(file, &input.Clusters) != nil {
      log.Error("Cannot unmarshal cluster config file")
   }

   if ! input.NoTimestamp && input.OutputFolder != "" {
      input.OutputFolder = input.OutputFolder + "/" + time.Now().Format("2006-01-02_15-04-05")
   }

}

// -----------------------------------------------------------------------------------------------------------------------
/*
INPUT:
   *** basic
   --cluster-config
   --list-of-cluster
   --list-of-configs

   *** matching
   + --config-with-matched-patterns
   config/yarn-site to store metrics to be skipped
   + --smart-match (arrays)
   --no-lack-of-data
   --skip-configs
   --do-not-put-config-in-separate-file

   *** output
   --output-folder
   --console
   --log-level
   --no-timestamp

TODO:
   flags
   input/output

*/

func init(){
   parse_arguments()
   // Log as JSON instead of the default ASCII formatter.
   log.SetFormatter(&log.TextFormatter{})

   // Output to stderr instead of stdout, could also be a file.
   log.SetOutput(os.Stderr)

   // Only log the warning severity or above.
   switch input.LogLevel {
      case "debug": log.SetLevel(log.DebugLevel)
      case "error": log.SetLevel(log.ErrorLevel)
      default: log.SetLevel(log.InfoLevel)
   }
   
}


func main(){


   configs := make([]Config, 0)
   for _, cl := range input.Clusters {
      configs = getClusterConfigs(cl, configs)
   }


   for _, config := range configs {
      if config.Name == "yarn-site" {
         properties := getConfigProperties(config, input.Clusters)
         processingProperties(properties, len(input.Clusters), config)
      }
   }

   fmt.Println("completed.")
}